import React from 'react';

import AppletViewAll from './Applet-ViewAll';
import AppletAddNew from './Applet-AddNew';

function Applet({appletViewState}, {setAppletViewState}) {  

  return (
    <div id="applet" className="App container col">

      {appletViewState === "home" ? (
        <></>
      ) : (
        <></>
      )};

      {appletViewState === "clients" ? (
        <AppletViewAll />
      ) : (
        <></>
      )};

      {appletViewState === "new-client" ? (
        <AppletAddNew />
      ) : (
        <></>
      )};

    </div>
  );
}

export default Applet;
